import logo from './logo.svg';
import './App.css';

class App extends Component{

   render() {
    <div className="App">
      <header className="App-header">
        <h1> Notre super POKEDEX version OCRES </h1>        
      </header>
      <input
        type="text"
        name="Pokemon"
        value={city}
        onChange={this.handleChange}
      />
    </div>
   }
    
}

export default App;
